const e=JSON.parse('{"key":"v-49d29838","path":"/linux/bash/archives/commands/du.html","title":"du","lang":"zh-CN","frontmatter":{"description":"du du 命令显示某个文件或目录的磁盘使用量。 du filename -h 参数将返回的大小显示为人类可读的格式，即显示单位为 K、M、G 等。 -s 参数表示总结(summarize)。 -x 参数表示不显示不在当前分区的目录，通常会忽略/dev、/proc、/sys 等目录。","head":[["meta",{"property":"og:url","content":"https://mrhope.site/linux/bash/archives/commands/du.html"}],["meta",{"property":"og:site_name","content":"Mr.Hope"}],["meta",{"property":"og:title","content":"du"}],["meta",{"property":"og:description","content":"du du 命令显示某个文件或目录的磁盘使用量。 du filename -h 参数将返回的大小显示为人类可读的格式，即显示单位为 K、M、G 等。 -s 参数表示总结(summarize)。 -x 参数表示不显示不在当前分区的目录，通常会忽略/dev、/proc、/sys 等目录。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2021-01-27T06:58:54.000Z"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"article:modified_time","content":"2021-01-27T06:58:54.000Z"}]]},"headers":[],"git":{"createdTime":1591204114000,"updatedTime":1611730734000,"contributors":[{"name":"Mr.Hope","email":"zhangbowang1998@gmail.com","commits":2}]},"readingTime":{"minutes":0.65,"words":194},"localizedDate":"2020年6月3日","filePathRelative":"linux/bash/archives/commands/du.md","excerpt":"<h1> du</h1>\\n<p><code>du</code> 命令显示某个文件或目录的磁盘使用量。</p>\\n<div class=\\"language-bash\\" data-ext=\\"sh\\"><pre class=\\"language-bash\\"><code><span class=\\"token function\\">du</span> filename\\n</code></pre></div><p><code>-h</code> 参数将返回的大小显示为人类可读的格式，即显示单位为 K、M、G 等。</p>\\n<p><code>-s</code> 参数表示总结(summarize)。</p>\\n<p><code>-x</code> 参数表示不显示不在当前分区的目录，通常会忽略<code>/dev</code>、<code>/proc</code>、<code>/sys</code> 等目录。</p>","autoDesc":true}');export{e as data};
